import React from 'react';
import './CSS/ErrorPage.css';

const NotFoundPage = () => {
  return (
    <div className="error-page classic-theme">
      <h1>404</h1>
      <p>Page Not Found</p>
    </div>
  );
};

export default NotFoundPage;
